import { Link } from "react-router-dom";

    function Navbar() {
       return( 
       <nav className="nav">
            <ul>
                    <Link to="/" className="site-title"> Sweet Feet </Link>
            </ul>

            <ul>
                <li className="active">
                    <Link to="/products"> Products </Link>
                </li>
                <li className="active">
                    <Link to="/profile"> Profile </Link>
                </li>
            </ul>

        </nav>
       )
    }

    export default Navbar;
